import 'main.dart';

// RUN THIS COMMAND TO CREATE the g.dart files
// flutter pub run build_runner build --delete-conflicting-outputs
part 'realm_neighborhood.g.dart';

final log = Logger("map_flutter");






// Utility function that manages the communication between the express/node server
// and the flutter application
Future<Realm_neighborhood> getRealmNeighborhood(String name, List<String> cuisines ) async {
  await dotenv.load(fileName: '.env');
  String? host = dotenv.env['HOST'];
  String? port = dotenv.env['PORT'];
  log.info("getRealmNeighborhood ${name}");
  String url = "http://${host}:$port/byNeighborhood?name=$name";
  if ( cuisines.isNotEmpty ) {
    final String  cuisine_string = json.encode(cuisines);
    url = url + '&cuisines=$cuisine_string';
  }

  final uri = Uri.parse(url);
  log.info("Url is " + uri.toString());
  try {
    final response = await http
        .get(uri)
        .timeout(const Duration(seconds: 10))
        .whenComplete(() => log.info("Done " ));
    if (response.statusCode == 200) {
      log.info("Success");
      return Realm_neighborhood.fromJson(jsonDecode(response.body));
    } else {
      log.shout("Failed: " + response.statusCode.toString());
    }
  } catch (e) {
    log.severe("Exception " + e.toString(), e);
  }
// in the case of an error the screen will default to a pre-downloaded data set
  //  note that the rootBundle.loadString  access a file in tbe assests folder and
  // added to the pubspec.yaml as an asset.
  return Realm_neighborhood.fromJson(
      json.decode(await rootBundle.loadString('assets/default_location.json')));
}



